return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'et','pot-creation-date'=>'2026-01-07 15:22-0600','po-revision-date'=>'2026-01-07 15:22-0600','translation-revision-date'=>'2026-01-07 15:22-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s on praegu %2$speatatud%3$s ja ei näita kalendreid esilehekülgedel. Kalendrite kuvamist saate taastada %4$sUtilities%5$s vahekaardil %6$ssiin%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sKasutate ICS Calendarit WordPress Playgroundi rakenduses.%2$s Kuna ICS Calendar on mõeldud kasutamiseks veebiserveris, võivad mõned funktsioonid olla kättesaamatud või mitte korralikult töötada.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sTeie veebisait kasutab praegu UTC-nihe põhist ajavööndi seadet.%2$s See võib põhjustada aja kuvamise vigu %3$spluginis kohtades, kus kasutatakse suveaega. Palun %4$smuutke oma ajavööndi seade%5$s oma asukohale lähimale linnale, mis asub samas ajavööndis, et aeg kuvataks õigesti. Lisateavet selle küsimuse kohta leiate meie %6$sdokumentatsioonist%7$s.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Oluline! Teie %1$s konfiguratsioon ületab ilmselt allika kalendri pakkuja määra piiranguid.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Kui teie kalendrid ei lae korralikult, kontrollige palun oma %1$s seadeid ja kasutamist:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Ära kasuta lühikoodides %1$s. See funktsioon on mõeldud ainult veaotsinguks ja seda ei tohiks jäädavalt sisse jätta.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Suurendage %1$s %2$sTransient (cache) expiration%3$s seadet väärtuseni %4$s43200%5$s (12 tundi) või suuremaks, et vähendada teenusepakkujale saadetavate päringute sagedust. (Vaadake allpool olevat märkust.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Vältige sama pakkuja suure arvu (10 või enam) feedide lisamist ühte lühikoodi %1$s.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Peatage ajutiselt ICS-kalender oma esilehekülgedel, kasutades selleks utiliiti %1$sPause Calendars%2$s (soovitatav on 24–48 tundi).','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s sisaldab sisseehitatud vahemällu salvestamist, mis on mõeldud spetsiaalselt jõudluse parandamiseks ja teenusepakkuja kiiruspiirangute ületamise vältimiseks. Selle vahemällu salvestamise vältimine väga madala %2$sreload%3$s seadistusega võib põhjustada kalendri teenusepakkuja poolt teie veebiserveri IP-aadressi või võimalik, et kogu teie hostinguvõrgu ajutise blokeerimise.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Pärast soovitatud muudatuste tegemist palume oodata kuni 24 tundi, kuni kalendri pakkuja eemaldab teie IP-aadressi ajutised blokeeringud. Kui probleem püsib, palume võtta meiega ühendust meie %1$stugiteenuse taotluse vormi%2$s kaudu ja lisada kindlasti oma %3$ssüsteemi aruanne%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Märkus: Seadke %1$sTransient (cache) expiration%2$s võimalikult suureks, arvestades, kui tihti kalendri sündmuste andmeid tavaliselt uuendatakse. %3$s Pange tähele, et vajaduse korral saate igal ajal käsitsi puhastada vahemälu, kasutades selleks utiliiti %4$sClear Cached Calendar Data%5$s.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sPange tähele:%2$s %3$s versioon 10.6 muudab mitme lühikoodi seadistuse vaikimisi valikuid. Järjepidevuse säilitamiseks ei ole need uued vaikimisi valikud %4$saktiveeritud%5$s, kui uuendate varasemast versioonist. Kui soovite muudatuste kohta rohkem teada saada, lugege meie %6$sblogipostitust%7$s või lülitage uued vaikimisi seaded sisse, aktiveerides %8$s valiku %9$s seadeid%10$s lehel.','Use new parameter defaults (v.10.6)'=>'Kasuta uusi parameetrite vaikimisi väärtusi (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sPange tähele:%2$s %3$s versioon 11.0 lihtsustab ICS-voo URL-ide hankimist. See muudatus kasutab WordPressi sisseehitatud standardfunktsiooni, seega peaks see olema täielikult ühilduv kõigi olemasolevate installatsioonidega. Kui pärast versioonile 11 või uuemale versioonile üleminekut tekib uusi probleeme, külastage abi saamiseks %4$sWordPressi tugifoorumeid%5$s.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sPange tähele:%2$s %3$s versioon 11.5.14.2 tutvustab uut, turvalisemat meetodit kalendriparameetrite käsitlemiseks AJAXi kaudu laadimisel. Palun kustutage kõik kasutatavad vahemälupistikprogrammid, et tagada kalendrite nõuetekohane laadimine uue meetodiga.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sTere tulemast versioonile %2$s 12!%3$s Versioon 12.0 sisaldab täiendavaid veaotsinguvahendeid, mitmeid jõudluse parandusi ja kasutajaliidese täiustusi. Lisateavet selle värskenduse kohta leiate %4$smuudatuste loendist%5$s.','Getting Started'=>'Alustamine','Settings'=>'Seaded','Appearance'=>'Välimus','Utilities'=>'Tööriistad','System Report'=>'Süsteemi aruanne','Support'=>'Tugi','Upgrade to %1$s!'=>'Uuenda versioonile %1$s!','Show/hide all'=>'Kuva/peida kõik','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'ICS-faili ei õnnestunud leida või see oli tühi. Kontrollige, kas URL on õige, ja vaadake oma php.ini konfiguratsiooni, et veenduda, kas cURL või allow_url_fopen on saadaval. Kui kasutate mitme URL-i eraldamiseks tühikuid, võite proovida kasutada selle asemel toru märki. Mõjutatud URL:','Hide past events'=>'Peida varasemad sündmused','Show past events'=>'Näita eelmisi sündmuseid','Contact:'=>'Kontakt:','Resources:'=>'Ressursid:','Click for more...'=>'Kliki, et näha rohkem...','Save to your calendar'=>'Salvesta oma kalendrisse','Cancelled'=>'Tühistatud','The legacy parser option is deprecated and will be removed in a future update.'=>'Vana parser-valik on vananenud ja eemaldatakse tulevases värskenduses.','Print'=>'Prindi','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Lühikoodi atribuut "currentweek" on vananenud. Kasutage selle asemel lühikoodis view="week".','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Lühikoodi atribuut "legendinline" on vananenud. Kasutage lühikoodis selle asemel legendstyle="inline".','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s on %2$staas%3$s alustanud kalendrite kuvamist esilehekülgedel. Kui teie veebisait kasutab vahemällu salvestavat pistikprogrammi, võib olla vaja vahemälu tühjendada.','%1$s has %2$spaused%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s on %2$speatanud%3$s kalendrite kuvamise esilehekülgedel. Kui teie veebisait kasutab vahemällu salvestamise pistikprogrammi, võib olla vaja vahemälu tühjendada.','Cleared %1$s %2$s transient(s).'=>'Kustutatud %1$s %2$s ajutine(d).','No %1$s transients were found.'=>'Ühtegi %1$s üleminekut ei leitud.','All saved ICS feed URLs have been cleared.'=>'Kõik salvestatud ICS-voo URL-id on kustutatud.','All %1$s settings have been reset to defaults, and saved ICS feed URLs have been cleared.'=>'Kõik %1$s seaded on taastatud vaikimisi seadetele ja salvestatud ICS-voo URL-id on kustutatud.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Teie feed\'i URL näib sisaldavat HTTP Basic Authentication\'i autentimisandmeid. Proovige lülitada välja %1$s valik eespool oleva %2$s vahekaardi all.','Use legacy feed request method'=>'Kasuta vana feed-päringu meetodit','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sSee URL viitab failile teie meediakogus.%2$s Kuigi te peaksite saama seda URL-i kasutada %3$slühikoodis, on see faili loomise hetke staatiline hetkeülevaade kalendrist ega kajasta allika kalendri tulevasi uuendusi. Õige dünaamilise feed-URL-i saamise juhised leiate meie %4$skasutusjuhendist%5$s.','Error: Could not resolve IP address for %1$s.'=>'Viga: IP-aadressi %1$s ei õnnestunud lahendada.','Resolved IP address for %1$s:'=>'%1$s jaoks määratud IP-aadress:','%1$sAppearance updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sVälimus uuendatud.%2$s Mõnede muudatuste nägemiseks võib olla vaja lehte uuendada.','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Väljale „Vaikimisi lühikood” sisestatud tekst ei ole kehtiv lühikood ja seda ei salvestatud.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sSeaded on uuendatud.%2$s Mõnede muudatuste nägemiseks võib olla vaja lehte uuendada.','calendar event'=>'kalendrisündmus','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Vana feed-päringu meetod on vananenud ja eemaldatakse lähitulevikus uuenduse käigus. Palun testige oma feed\'eid, lülitades vana feed-päringu meetodi välja.','Future updates of %1$s will require WordPress 5.3 or newer. Please update your site to a newer version of WordPress as soon as possible.'=>'%1$s tulevased uuendused nõuavad WordPressi versiooni 5.3 või uuemat. Palun uuendage oma veebisait võimalikult kiiresti uuemale WordPressi versioonile.','Map'=>'Kaart','Recurring event'=>'Korduv sündmus','Recurs every %1$s years'=>'Kordub iga %1$s aasta järel','Recurs yearly'=>'Kordub igal aastal','Recurs every %1$s months'=>'Kordub iga %1$s kuu järel','Recurs monthly'=>'Kordub igakuuliselt','Recurs every %1$s weeks'=>'Kordub iga %1$s nädala järel','Recurs weekly'=>'Kordub iganädalaselt','Recurs every %1$s days'=>'Kordub iga %1$s päeva järel','Recurs daily'=>'Kordub iga päev','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Teie %1$s lühikoodis olev omadus „url” näib sisaldavat HTML-sildid; tõenäoliselt on teie URL muudetud klõpsatavaks lingiks. Selle tulemusena ei pruugi teie kalender õigesti kuvada. Palun eemaldage lühikoodist klõpsatav link.','The r34ics_url_get_contents() function is no longer supported.'=>'Funktsiooni r34ics_url_get_contents() enam ei toetata.','Add %1$s'=>'Lisa %1$s','Close'=>'Sulge','ICS Feed URL:'=>'ICS-voo URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Veenduge, et kasutate %1$stellimise%2$s URL-i, mitte %3$sveebivaate%4$s URL-i.%5$s (URL-i otse veebibrauserisse sisestades peaks alla laadima %6$s fail.)','Calendar Title:'=>'Kalendri pealkiri:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Jäta tühjaks, et kasutada kalendri vaikimisi pealkirja. Sisesta %1$s, et pealkiri täielikult välja jätta.','Calendar Description:'=>'Kalendri kirjeldus:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Jäta tühjaks, et kasutada kalendri vaikimisi kirjeldust. Sisesta %1$s, et kirjeldus täielikult välja jätta.','View:'=>'Vaata:','month'=>'kuu','list'=>'loend','week'=>'nädal','Count:'=>'Arv:','Format:'=>'Vorming:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Jätke %1$s tühjaks, et lisada kõik eelseisvad sündmused. %2$s peab olema standardne %3$sPHP kuupäeva formaadi string%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Näita sündmuste kirjeldusi %1$s(muuda lühikoodis sisestatud numbriks, et määrata sõnade piirarv)%2$s','Show event locations %1$s(if available)%2$s'=>'Näita ürituste asukohad %1$s(kui saadaval)%2$s','Show event organizers %1$s(if available)%2$s'=>'Näita ürituse korraldajaid %1$s(kui olemas)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sMärkus:%2$s Lisaks on saadaval %3$skuvamisvalikud%4$s, mida saab käsitsi muuta pärast lühikoodi sisestamist.','Insert %1$s'=>'Sisesta %1$s','Do even more with %1$s version 6!'=>'Tee veelgi rohkem versiooniga %1$s 6!','Calendar Builder + Block Editor'=>'Kalendri looja + plokkide redigeerija','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Konfigureerige kõik kalendri seaded lihtsa visuaalse liidese abil ja kasutage uut %1$s plokki, et valida oma salvestatud kalendrid ploki redaktori rippmenüüst, lühikoodi pole vaja! %2$sLisateave...%3$s','Additional Views and Enhanced Features'=>'Lisavaated ja täiustatud funktsioonid','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s pakub palju uusi võimalusi kalendri kuvamiseks, sealhulgas integratsiooni populaarsete %2$s ja %3$s avatud lähtekoodiga raamatukogudega. Kuu- ja aastaülevaated koos valitud päeva külgribaga. "Up Next" sobib hästi raadio- või telekanalite programmide jaoks. Vidin ja aasta kättesaadavus on ideaalsed puhkuse broneeringute jaoks. Lisaks on põhivaadetele Kuu, Põhi, Nimekiri ja Nädal lisatud täiendavaid võimalusi. %4$sVaata näidiskalendreid...%5$s','Customization'=>'Kohandamine','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Lihtsalt kasutatavad tööriistad kalendri värvide, kirjatüüpide ja muude elementide täielikuks kohandamiseks. Valige üks meie eelseadistatud värvipalettidest või looge oma, kasutades võimalusi kalendri kujunduse iga elemendi värvi individuaalseks kohandamiseks. Valige teemakirjatüüpide, süsteemikirjatüüpide või enam kui 20 kaasasoleva avatud lähtekoodiga kirjatüübi hulgast. %1$sLisateave...%2$s','ICS Events'=>'ICS üritused','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Muudab %1$s täielikuks kalendri haldamise süsteemiks. Looge ja redigeerige uusi sündmusi otse WordPressis ning integreerige need sujuvalt oma olemasolevate väliste ICS-voogudega. %2$sLisateave...%3$s','Localized Admin Interface'=>'Kohandatud administraatori liides','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Kõik %1$s administraatorileheküljed on tõlgitud kümnetesse keeltesse, sealhulgas inglise, tšehhi, taani, saksa, kreeka, hispaania, eesti, soome, prantsuse, ungari, itaalia, jaapani, korea, leedu, läti, norra, hollandi, poola, portugali, rumeenia, vene, slovaki, serbia, rootsi, türgi, ukraina ja hiina keelde.','Visit %1$s to learn more.'=>'Lisateabe saamiseks külastage %1$s.','Calendar Builder screenshot'=>'Kalendri looja ekraanitõmmis','Appearance screenshot'=>'Välimus ekraanitõmmis','Available now!'=>'Nüüd saadaval!','Get %1$s!'=>'Hangi %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'%1$s pakub laia värvipaletti ja tüüpograafia valikuid. %2$sLisateave%3$s','Color Palette'=>'Värvipalett','Match calendar color palette to current Block Theme colors'=>'Värvipalett sobitada praeguse ploki teema värvidega','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Asendab %1$s vaikimisi neutraalse värvipaleti lähimate vastetega praegusest Site Editor Styles värvipalettist või teie teema %2$s failist. Värvivalikud on algoritmilised ja mõned kombinatsioonid ei pruugi läbida juurdepääsetavuse kontrastiteste. See seade ei mõjuta, kui kasutate "klassikalist" teemat, mis ei sisalda %3$s faili.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sSee on praegu beetaversioon.%2$s Optimaalse kuvamise tagamiseks võib olla vaja teha mõned muudatused kalendri välimuses või CSS-is, eriti kui olete oma vood värvikoodidega märgistanud. Funktsionaalsus võib muutuda.','Dark mode'=>'Tume režiim','Inverts color palette (light colors on a dark background).'=>'Pöörab värvipaleti ümber (heledad värvid tumedal taustal).','Save Changes'=>'Salvesta muudatused','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Täname, et installisite %1$s. Enne esimese kalendri lühikoodi loomist külastage palun oma %2$sÜldised seaded%3$s lehte ja kontrollige, et teie veebisaidi keel, ajavöönd ja kuupäeva/kellaaja formaadi seaded on õiged. Lisateavet leiate meie %4$skasutusjuhendist%5$s.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Alustage %1$s nelja lihtsa sammuga... ja esimene samm on juba tehtud! Ülejäänu leiate meie %2$skiirjuhendist%3$s.','Quick Start Guide'=>'Kiirjuhend','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Meie veebisaidil on saadaval põhjalik %1$skasutusjuhend%2$s. Allpool on mõned kiirlingid dokumentatsiooni olulisematele allikatele.','General:'=>'Üldine:','General WordPress Settings'=>'WordPressi üldised seaded','%1$s Settings'=>'%1$s Seaded','Working with Shortcodes:'=>'Lühikoodidega töötamine:','Shortcode Overview'=>'Lühikoodi ülevaade','Shortcode Builder'=>'Lühikoodide looja','Shortcode Parameters Reference'=>'Lühikoodi parameetrite viited','Advanced Topics:'=>'Täpsemad teemad:','FAQs and Tips'=>'Korduma kippuvad küsimused ja näpunäited','CSS Guide'=>'CSS-juhend','Developer Resources'=>'Arendaja ressursid','GDPR'=>'GDPR','Loading'=>'Laen','Always use AJAX to render calendars'=>'Kasutage kalendrite kuvamiseks alati AJAX-i.','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'AJAX-i laadimine toimub nüüd automaatselt. Vajaduse korral saate AJAX-i ümber kirjutada, lisades oma lühikoodile %1$s.','Increase memory limit when rendering calendars'=>'Suurendage kalendrite renderdamisel mälu piirmäära','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Kui teie kalender ei lae ja kuvab veateate „mälu puudub”, proovige suurendada mälu piirmäära. Soovitatav on vähemalt 512 MB. %1$s Märkused: 1) Mõned hostinguteenuse pakkujad ei luba rakendustel serveri vaikimisi seadeid ümber kirjutada. 2) Seda valikut ei ole võimalik seadistada madalamaks kui teie serveri praegune vaikimisi mälu piirmäär.','deprecated'=>'vananenud','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Mõned serverid ei pruugi toetada vaikimisi feed-päringu meetodit. Kui teie feed\'id ei lae, lülitage see valik sisse, et kasutada vana päringu meetodit. See funktsioon on vananenud ja eemaldatakse tulevases värskenduses.','Default shortcode'=>'Vaikimisi lühikood','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Kui teie veebisait sisaldab suurt hulka sarnaselt konfigureeritud kalendri lühikoode, võite siia sisestada vaikimisi „baas” lühikoodi koos parameetritega, mis peaksid olema ühesugused kõikide kalendrite puhul. Veebisaidi üksikud lühikoodid võivad seejärel sisaldada ainult selle kalendri jaoks unikaalseid parameetreid, näiteks: %1$s Üksikutes lühikoodides sisalduvad parameetrid asendavad siin määratud parameetrid.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Luba juurdepääs nendele hostinimedele, mis lahenduvad reserveeritud IP-aadressideks','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Kui teie kalendri server asub samal füüsilisel serveril kui teie veebisait, kuulub samasse kohalikku võrku või kasutab muul viisil %1$sreserveeritud IP-aadressi%2$s, sisestage siia selle hostinimi, et lubada juurdepääs. Mitme kalendri serveri puhul sisestage üks hostinimi reale. Lisateavet leiate %3$sdokumentatsioonist%4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Sisestage üks hostinimi rida kohta. Hostinimed on baasdomeeninimed, mitte täielikud URL-id. %1$s Näiteks sisestaksite %2$s, mitte %3$s.','Allow access to these ports'=>'Luba juurdepääs nendele portidele','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress lubab automaatselt juurdepääsu portidele 80, 443 ja 8080. Kui teil on vaja juurdepääsu allikakalendritele, mis kasutavad mittestandardseid porte, sisestage siia portide numbrid, eraldades need komadega.','Caching'=>'Vahemälustamine','Transient (cache) expiration'=>'Ajutine (vahemälu) aegumine','seconds'=>'sekundit','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Määrab, kui kaua kalendri feed-andmed peaksid enne uuesti laadimist serveris (WordPressi transients) vahemällu salvestatud olema. Vaikimisi on see 3600 (1 tund). Minimaalne lubatud väärtus on 120 (2 minutit).','Admin'=>'Admin','Minimum access role'=>'Minimaalne juurdepääsuõigus','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Määrab minimaalse kasutajarolli, millel on lubatud juurdepääs %1$s administraatorilehtedele. Teatud valdkonnad, nagu näiteks Seaded, on veelgi piiratud ainult %2$s kasutajatele (%3$s kasutajatele mitme saidi konfiguratsioonides).','Register Customizer'=>'Registreeri kohandaja','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress ei sisalda enam lingi Customizerile menüüs Appearance, kui Block Theme on aktiivne. Märkige see kast, kui soovite kasutada Customizerit, näiteks täiendava CSS-i sisestamiseks. Märkus: Mõned teemad või pluginad võivad juba registreerida Customizeri, sel juhul ei ole sellel seadistusel mingit mõju. (Kastike aktiveerib Customizeri ainult siis, kui see on märgitud; see ei deaktiveeri Customizerit, kui see on märkimata.','Remove "Add ICS Calendar" button in Classic Editor'=>'Eemalda klassikalises redaktoris nupp „Lisa ICS-kalender”','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Vaikimisi lisab ICS Calendar klassikalise redaktori kasutamisel WYSIWYG-redaktori kohal asuvasse tööriistaribale nupu „Lisa ICS Calendar”. Märkige see ruut, et nupp eemaldada. Ei mõjuta veebisaite, mis kasutavad plokiredaktorit (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versioonis 10.6 lisati mitmele lühikoodi parameetrile uued vaikimisi väärtused. Uued installatsioonid kasutavad automaatselt uusi vaikimisi väärtusi, kuid uuendatud installatsioonid jätkavad vanade vaikimisi väärtuste kasutamist, kui see kast ei ole märgitud. Lisateavet nende muudatuste kohta leiate %2$smeie blogist%3$s.','User Guide'=>'Kasutusjuhend','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Meie täielik kasutusjuhend on kättesaadav täieliku tõlkega kümnetesse keeltesse meie veebisaidil:','For assistance, please use our %1$ssupport request form%2$s.'=>'Abi saamiseks kasutage palun meie %1$stugiteenuse taotluse vormi%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Kui võtate ühendust klienditoega, lisage palun sellelt lehelt %1$ssüsteemi aruanne%2$s.','Spread the word!'=>'Levitage sõnumit!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Kui leiate %1$s kasulikuks, saate aidata toetada meie jätkuvat kasvu ja arengut %2$sviie tärni hinnanguga%3$s. Täname!','Calendar Status: %1$sPaused%2$s'=>'Kalendri staatus: %1$sPeatatud%2$s','Calendar Status: %1$sActive%2$s'=>'Kalendri staatus: %1$sAktiivne%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Kasutage pausinuppu, kui soovite ajutiselt välja lülitada %1$s oma esilehekülgedel.','Resume Calendars'=>'CV-kalendrid','Pause Calendars'=>'Pausikalendrid','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Sisu ei muudeta, kuid teie kalendrid peidetakse ja esilehele ei laadita ühtegi %1$s ressursifaili (JavaScript, CSS). Kui kasutate vahemällu salvestamist pistikprogrammi või oma veebimajutuse pakkuja kaudu, võib olla vaja pärast selle seade muutmist vahemälu tühjendada.','%1$s Data Cache'=>'%1$s Andmete vahemälu','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'See kustutab kohe kõik olemasolevad kalendri andmed (puhastab ajutised andmed), sundides WordPressi järgmisel vaatamisel kõik kalendrid uuesti laadima. Puhverdamise funktsioon jätkub seejärel nagu varem.','Clear Cached Calendar Data'=>'Puhasta kalendri vahemäluandmed','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Kui kasutate kolmanda osapoole vahemällu salvestamise pistikprogrammi, võib olla vaja pärast selle utiliidi käivitamist puhastada kogu veebisaidi vahemälu.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Oled sa kindel? See nullib kõik %1$s seaded vaikimisi. Teie salvestatud kalendrikonfiguratsioonid ja lühikoodid säilivad, kuid vaikimisi seadistuste lähtestamine võib muuta teie kalendrite välimust. Kui kasutate kolmanda osapoole vahemälupluginaid, peate pärast selle utiliidi käivitamist võib-olla kogu saidi vahemälu tühjendama.','Only clear transients (default)'=>'Ainult selged üleminekud (vaikimisi)','Also clear all saved ICS feed URLs'=>'Kustuta ka kõik salvestatud ICS-voo URL-id','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Taasta %1$skõik%2$s %3$s seaded (sh üleminekud ja feed-URL-id)','Last cleared:'=>'Viimati puhastatud:','never'=>'mitte kunagi','ICS Feed URL Tester'=>'ICS-voo URL-i testija','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Kui teile tundub, et plugin ei lae teie uudisvoogu korralikult, saate URL-i siin testida.','Enter feed URL...'=>'Sisesta feed\'i URL...','Test URL'=>'Testi URL','Results:'=>'Tulemused:','%1$s received.'=>'%1$s saadud.','This appears to be a valid ICS feed URL.'=>'See näib olevat kehtiv ICS-voo URL.','unknown'=>'tundmatu','This does not appear to be a valid ICS feed URL.'=>'See ei tundu olevat kehtiv ICS-voo URL-aadress.','Could not retrieve data from the requested URL.'=>'Päringut soovitud URL-ist ei õnnestunud teostada.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Soovitud URL-i kuvamisel tekkis tundmatu viga.','Please copy the following text and include it in your message when emailing support.'=>'Kopeerige järgmine tekst ja lisage see oma sõnumisse, kui saadate e-kirja klienditoele.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Lisage ka lühikood %1$s täpselt nii, nagu te olete selle asjaomasele lehele sisestanud.','No events found.'=>'Ühtegi sündmust ei leitud.','Previous Page'=>'Eelmine lehekülg','Next Page'=>'järgmine lk','All Day'=>'Kogu päev','Previous Month'=>'Eelmine kuu','Next Month'=>'Järgmine kuu','Today'=>'Täna','Month selection'=>'Kuu valik','No events.'=>'Üritusi pole.','No additional events this month.'=>'Sel kuul pole lisasündmusi.','Week selection'=>'Nädala valik','Last week'=>'Eelmine nädal','This week'=>'See nädal','Next week'=>'Järgmine nädal','ICS Calendar'=>'ICS kalender','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Muutke oma Google Kalender, Microsoft Office 365 või Apple iCloud Kalender sujuvalt integreeritud, automaatselt uuenevaks ja hooldusvabaks WordPressi kogemuseks.','Room 34 Creative Services, LLC'=>'Tuba 34 Loomingulised teenused, LLC']];
